    def validate_credit_card_number(self,credit_card_number):
        # Remove any spaces or hyphens in the credit card number string
        credit_card_number = credit_card_number.replace(" ", "").replace("-", "")

        # Check that the credit card number string contains only digits
        if not credit_card_number.isdigit():
            return False

        # Apply the Luhn algorithm to the credit card number
        digits = list(map(int, credit_card_number))
        for i in range(len(digits)-2, -1, -2):
            digits[i] = sum(divmod(digits[i]*2, 10))
        return sum(digits) % 10 == 0

    def validate_number_string(self,input_str):
        try:
            int(input_str)
            return True
        except ValueError:
            return False

